import React, { Component } from "react";
import Sky from "./Sky";

export default class Ads extends Component {
  render() {
    return (
      <div className="ads">
        <Sky title="تبلیغات در گوگل" />
        <div className="google-results">
          {[...Array(5).keys()].map(item => {
            return <div className="bg-danger">
              <h3 />
              <cite />
            </div>;
          })}
        </div>
      </div>
    );
  }
}
